$('input[type=radio][name=frequency]').on('change' , function (event){
var freq = this.value;
if(freq=="m"){
$(".period").html('<?php echo getSavedFmonth_options(false,NULL); ?>');
$(".period").attr("name","fmonth");
$(".period").attr("id","fmonth");
}
if(freq=="q"){
$(".period").html('<?php echo getAllQuarterOptions(false,NULL); ?>');
$(".period").attr("name","qmonth");
$(".period").attr("id","qmonth");
}
if(freq=="fy"){
$(".period").html('<?php echo getAllfiscalYearsOptions(false,NULL); ?>');
$(".period").attr("name","fyear");
$(".period").attr("id","fyear");
}
if(freq=="y"){
$(".period").html('<?php echo getAllYearsOptions(false,NULL); ?>');
$(".period").attr("name","fyear");
$(".period").attr("id","fyear");
}
$("#filter-form").submit();
});
